            mainpara="Airdrop to multiple users in few clicks."
          />

          <Topnavicon2 />

          <div className="clear mar-22"></div>
          {/* content1  */}
          {/* <Locker_coin_sec /> */}
          <Form />
          {/* <Project_details /> */}
          {/* content2 */}
          {/* <Airdrops_arbor_right_sec /> */}
        </div>

        <div className="clear"></div>
      </div>
    );
  }
}

export default Home;
